import logo from './logo.svg';
import './App.css';
import App_Skill from './App_Skill';

import 'bootstrap/dist/css/bootstrap.min.css';
import App_Login from './App_Login';
import App_Register from './App_Register';
import { Navbar, Container, Nav,NavDropdown,Row } from 'react-bootstrap';
import App_UserProfile from './App_UserProfile';

function App() {

  return (
    <div className="">
        <Router>
            <Route path="/" component={App}>
            <Route path="page1" component={Page1} />
            <Route path="page2" component={Page2} />
            </Route>
            <Route path="/UserProfile" component={Login} />
        </Router>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">CRUD React user</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link to="/">Home</Nav.Link>
              <Nav.Link to="/UserProfile">User Profile</Nav.Link>
              <NavDropdown title="Master" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Skill</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Skill Level</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
     {/* <App_Skill/> */}
     {/* <App_Login/> */}
      {/* <App_Register/> */}
      <App_UserProfile/>
    </div>
  );
}

export default App;
